    <div className="App">
      <div className="left-panel">
        Brigthess
        <input
          id="slider"
          type="range"
          min="-1"
          max="1"
          step="0.05"
          defaultValue="0"
          onChange={e => {
            setBrightness(parseFloat(e.target.value));
          }}
        />
        <RegionsList />          
      </div>
      <div className="right-panel">
        <Canvas />
        
      </div>
    </div>
  </React.Fragment>
);
};

